import React from "react";
import Contacts from "./contacts";
import Cards from "./props";
import Avatar from "../Avatar";

function Main(){
    return (
        <div>
        <h1 className="heading">My contacts</h1>
        <Cards
        name={ Contacts[0].name }
        img={ Contacts[0].img } 
        tel={ Contacts[0].tel }
        email={ Contacts[0].email }
        />
         <Cards
        name={ Contacts[0].name }
        img={ Contacts[0].img }
        tel={ Contacts[0].tel }
        email={ Contacts[0].email }
        />
         <Cards
        name={ Contacts[0].name }
        img={ Contacts[0].img }
        tel={ Contacts[0].tel }
        email={ Contacts[0].email }
        />.   
        </div>
    );
};
export default Main;
